import './App.css'
import Header from './common/header/Header'
var Router = require("react-router-dom").BrowserRouter;
var Switch = require("react-router-dom").Switch;
// var Route = require("react-router-dom").Route;

function App() {
  return (
    <>
    <Router>
      <Header />
      <Switch>
      <Route path='/' exact>
        <About />
      </Route>
      </Switch>
    </Router>
      
    </>
  );
}

export default App
